INSERT INTO `books` VALUES (1,'Fourth Wing',1,4,'A young scribe is thrust into an elite war college for dragon riders where the only rule is graduate or perish. An addictive fantasy with epic levels of spice and world-building.',29.99,2,1,'2023-12-02 14:52:19',528,'',1),(2,'Iron Flame',1,4,'Violet may have survived her first year at Basgiath War College for dragon riders, but this epic adventure is just heating up. An electrifying follow-up to a brutally addictive fantasy.',29.99,0,NULL,'2023-12-02 14:52:19',640,'',1),(3,'House of Sky and Breath',2,4,'Urban fantasy meets high fantasy, with all the witty dialogue and slow-burn romance you\'ve come to expect from Sarah J. Maas. Bryce and Hunt are back! They may have saved the city, but they are once again pulled into the fight. And, in a world on the brink, staying silent is not an option. This second installment of the stunning Crescent City series is all you could ask for and more.',24.99,1,1,'2023-12-02 14:54:29',768,'',1),(4,'House of Flame and Shadow',2,4,'Bryce Quinlan never expected to see a world other than Midgard, but now that she has, all she wants is to get back. Everything she loves is in Midgard: her family, her friends, her mate. Stranded in a strange new world, she\'s going to need all her wits about her to get home again. And that\'s no easy feat when she has no idea who to trust.',28.99,0,NULL,'2023-12-02 14:54:29',848,'',1),(5,'House of Earth and Blood',2,4,'Bryce Quinlan had the perfect life-working hard all day and partying all night-until a demon murdered her closest friends, leaving her bereft, wounded, and alone. When the accused is behind bars but the crimes start up again, Bryce finds herself at the heart of the investigation. She\'ll do whatever it takes to avenge their deaths. ',24.99,0,1,'2023-12-02 14:54:29',816,'',1),(6,'Kingdom of Ash',2,4,'Aelin Galathynius has vowed to save her people-but at a tremendous cost. Locked in an iron coffin by the Queen of the Fae, Aelin must draw upon her fiery will as she endures months of torture. The knowledge that yielding to Maeve will doom those she loves keeps her from breaking, but her resolve unravels with each passing day.',21.99,0,NULL,'2023-12-02 14:58:14',992,'',1),(7,'Heir of Fire',2,4,'Celaena Sardothien has survived deadly contests and shattering heartbreak, but now she must travel to a new land to confront her darkest truth. That truth could change her life-and her future-forever. ',24.99,0,NULL,'2023-12-02 14:58:14',592,'',1),(8,'Crown of Midnight',2,4,'Celaena Sardothien won a brutal contest to become the King\'s Champion. But she is far from loyal to the crown. Though she goes to great lengths to hide her secret, her deadly charade becomes more difficult when she realizes she is not the only one seeking justice. Her search for answers ensnares those closest to her, and no one is safe from suspicion-not the Crown Prince Dorian; not Chaol, the Captain of the Guard; not even her best friend, Nehemia, a princess with a rebel heart.',24.99,0,1,'2023-12-02 14:58:14',448,'',1),(9,'Tower of Dawn',2,4,'Chaol Westfall and Nesryn Faliq have arrived in the shining city of Antica to forge an alliance with the Khagan of the Southern Continent, whose vast armies are Erilea\'s last hope. But they have also come to Antica for another purpose: to seek healing at the famed Torre Cesme for the wounds Chaol received in Rifthold. ',24.99,0,NULL,'2023-12-02 14:58:14',688,'',1),(10,'Empire of Storms',2,4,'The long path to the throne has only just begun for Aelin Galathynius as war looms on the horizon. Loyalties have been broken and bought, friends have been lost and gained, and those who possess magic find themselves increasingly at odds with those who don\'t.',24.99,0,1,'2023-12-02 14:58:14',720,'',1),(11,'Queen of Shadows',2,4,'Aelin Galathynius takes her place as queen in the fourth book of the #1 bestselling Throne of Glass series by Sarah J. Maas.',24.99,0,NULL,'2023-12-02 14:58:14',672,'',1),(12,'Throne of Glass',2,4,'This lush, one-of-a-kind edition of the book that started a world-wide phenomenon tells the sweeping saga of Celaena Sardothien who lives in a land without magic, where the king rules with an iron hand. Celaena is summoned to the castle-not to assassinate the king, but to win her freedom. If she defeats twenty-three killers, thieves, and warriors in a competition, she will be released from prison to serve as the king\'s champion.',36.49,0,NULL,'2023-12-02 14:58:14',432,'',1),(13,'Drunk on Love',3,2,'Margot Noble needs some relief from the stress of running the family winery with her brother. Enter Luke: sexy, charming, and best of all in the too-small world of Napa, a stranger. The chemistry between them is undeniable, and Margot is delighted that she lucked into the perfect one-night stand she\'ll never have to see again. That is, until the winery\'s newest hire, Luke, walks in the next morning. Margot is determined to keep things purely professional, but when their every interaction reminds her of the attraction still bubbling between them, it proves to be much more challenging than she expects. ',25.11,0,1,'2023-12-04 13:18:25',400,'',1),(14,'The Wedding Party',3,2,'After an \"oops, we made a mistake\" night together, neither one can stop thinking about the other. With Alexa\'s wedding rapidly approaching, Maddie and Theo both share bridal party responsibilities that require more interaction with each other than they\'re comfortable with. Underneath the sharp barbs they toss at each other is a simmering attraction that won\'t fade. It builds until they find themselves sneaking off together to release some tension when Alexa isn\'t looking, agreeing they would end it once the wedding is over. ',44.79,0,NULL,'2023-12-04 13:19:11',352,'',1),(15,'Royal Holiday',3,2,'Vivian Forest has been out of the country a grand total of one time, so when she gets the chance to tag along on her daughter Maddie\'s work trip to England to style a royal family member, she can\'t refuse. She\'s excited to spend the holidays taking in the magnificent British sights, but what she doesn\'t expect is to become instantly attracted to a certain private secretary, his charming accent, and unyielding formality. ',15.81,0,NULL,'2023-12-04 13:19:28',320,'',1),(16,'While We Were Dating',3,2,'wo people realize that it\'s no longer an act when they veer off-script in this sizzling romantic comedy by New York Times bestselling author Jasmine Guillory.',39.95,0,1,'2023-12-04 13:19:52',384,'',1),(17,'Mrs. S',4,2,'In an elite English boarding school where the girls kiss the marble statue of the famous dead author who used to walk the halls, a butch antipodean outsider arrives to take up the antiquated role of \"matron.\" Within this landscape of immense privilege, where difference is met with hostility, the matron finds herself unsure of her role, her accent and her body.',16.74,0,NULL,'2023-12-04 13:20:29',240,'',1);
INSERT INTO `books` VALUES (18,'Wreck the Halls',5,2,'Melody Gallard may be the daughter of music royalty, but her world is far from glamorous. She spends her days restoring old books and avoiding the limelight (one awkward tabloid photo was enough, thanks). But when a producer offers her a lot of money to reunite her mother\'s band on live tv, Mel begins to wonder if it\'s time to rattle the cage, shake up her quiet life... and see him again. The only other person who could wrangle the rock and roll divas.',17.66,0,1,'2023-12-04 13:21:02',368,'',1),(19,'Before I Let Go',6,2,'Their love was supposed to last forever. But when life delivered blow after devastating blow, Yasmen and Josiah Wade found that love alone couldn\'t solve or save everything.',24.18,0,NULL,'2023-12-04 13:21:39',400,'',1),(20,'Iris Kelly Doesn\'t Date',7,2,'Everyone around Iris Kelly is in love. Her best friends are all coupled up, her siblings have partners that are perfect for them, and her parents are still blissfully married. And she\'s happy for all of them, truly. Iris doesn\'t want any of that--dating, love, romance. She\'ll stick to her commitment-free hookups, thanks very much, except no one in her life will just let her be. Everyone wants to see her settled down, but she holds firmly to her no dating rule. There\'s only one problem--Iris is a romance author facing an imminent deadline for her second book, and she\'s completely out of ideas. ',16.74,0,NULL,'2023-12-04 13:22:12',416,'',1),(21,'A Perfect Vintage',8,2,'Lea Mortimer has everything under control. As a highly sought-after consultant specializing in transforming dilapidated French country estates into boutique hotels, she relishes her freedom as a single, childfree woman. And her life is full, occupied as much by her impeccable historic renovations as by the aristocratic -- and often exhausting -- French families she works for.',17.67,0,1,'2023-12-04 13:22:47',382,'',1),(22,'Never Whistle at Night',9,1,'Many Indigenous people believe that one should never whistle at night. This belief takes many forms: for instance, Native Hawaiians believe it summons the Hukai\'po, the spirits of ancient warriors, and Native Mexicans say it calls Lechuza, a witch that can transform into an owl. But what all these legends hold in common is the certainty that whistling at night can cause evil spirits to appear--and even follow you home. ',26.96,0,NULL,'2023-12-04 13:23:53',416,'',1),(23,'The Reformatory',10,1,'Twelve-year-old Robbie Stephens, Jr., is sentenced to six months at the Gracetown School for Boys, a reformatory, for kicking the son of the largest landowner in town in defense of his older sister, Gloria. So begins Robbie\'s journey further into the terrors of the Jim Crow South and the very real horror of the school they call The Reformatory.',26.96,0,1,'2023-12-04 13:24:29',576,'',1),(24,'Bury Your Gays',11,1,'Misha knows that chasing success in Hollywood can be hell.',25.1,0,NULL,'2023-12-04 13:25:29',304,'',1),(25,'Holly',12,1,'Stephen King\'s Holly marks the triumphant return of beloved King character Holly Gibney. Readers have witnessed Holly\'s gradual transformation from a shy (but also brave and ethical) recluse in Mr. Mercedes to Bill Hodges\'s partner in Finders Keepers to a full-fledged, smart, and occasionally tough private detective in The Outsider. In King\'s new novel, Holly is on her own, and up against a pair of unimaginably depraved and brilliantly disguised adversaries. ',27.9,0,1,'2023-12-04 13:25:29',464,'',1),(26,'Camp Damascus',11,1,'Welcome to Neverton, Montana: home to a God-fearing community with a heart of gold.',24.17,0,1,'2023-12-04 13:25:44',256,'',1),(27,'House of Leaves',13,1,'Years ago, when House of Leaves was first being passed around, it was nothing more than a badly bundled heap of paper, parts of which would occasionally surface on the Internet. No one could have anticipated the small but devoted following this terrifying story would soon command. Starting with an odd assortment of marginalized youth--musicians, tattoo artists, programmers, strippers, environmentalists, and adrenaline junkies--the book eventually made its way into the hands of older generations, who not only found themselves in those strangely arranged pages but also discovered a way back into the lives of their estranged children.',51.15,0,1,'2023-12-04 13:25:44',736,'',1),(28,'Vampires of El Norte',14,1,'As the daughter of a rancher in 1840s Mexico, Nena knows a thing or two about monsters--her home has long been threatened by tensions with Anglo settlers from the north. But something more sinister lurks near the ranch at night, something that drains men of their blood and leaves them for dead. ',26.04,0,1,'2023-12-04 13:27:02',384,'',1),(29,'A Guest in the House',15,1,'After many lonely years, Abby\'s just gotten married. She met her new husband--a recently widowed dentist--when he arrived in town with his young daughter, seeking a new start. Although it\'s strange living in the shadow of her predecessor, Abby does her best to be a good wife and mother. But the more she learns about her new husband\'s first wife, the more things don\'t add up. And Abby starts to wonder . . . was Sheila\'s death really by natural causes? As Abby sinks deeper into confusion, Sheila\'s memory seems to become a force all its own, ensnaring Abby in a mystery that leaves her obsessed, fascinated, and desperately in love for the first time in her life. ',26.03,0,NULL,'2023-12-04 13:28:01',256,'',1),(30,'Our Share of Night',16,1,'A young father and son set out on a road trip, devastated by the death of the wife and mother they both loved. United in grief, the pair travel to her ancestral home, where they must confront the terrifying legacy she has bequeathed: a family called the Order that commits unspeakable acts in search of immortality. ',17.66,0,NULL,'2023-12-04 13:28:01',608,'',1);
